import React, {Component} from 'react';
import "./inputForm.css"
import axios from "axios";

class InputForm extends Component {
	render() {
		return (
	      <div className = "container-fluid align-items-center" id = "inputForm">
	          <div className = "jumbotron">
	          	<h1> {this.props.articles[0].title} </h1>
	              <form action = "" method="post"> 
	                <div>
	                  <input type = "text" name = "country" placeholder = "Enter country pls" />
	                </div>

	                <div>
	                  <input type = "text" name = "date" placeholder = "Enter date pls" />
	                </div>

	                <button> Submit </button>
	              </form>
	          </div>
	      </div>);

	}

}

export default InputForm;
